import React from 'react';
import hs from './Header.module.css'
import {NavLink} from "react-router-dom";
import AccountIconComponent from "./AcountIcon";
import {LogOutThunk} from "../../data/AuthReducer";






const Header = (props) => {

    return <header className={hs.header}>
        <div className={hs.item}>
            {props.IsLogined
                ?
                <div className={hs.AccountIconPosition}>

                    <AccountIconComponent LogOutThunk={LogOutThunk}
                                          UserProfile={props.UserProfile}/>
                    <div>
                        <button className={hs.log} onClick={() => {
                            props.LogOutThunk()
                        }}>
                            Logout
                        </button>
                    </div>

                </div>

                :


                        <div className={hs.log}>
                            Login
                        </div>


            }

        </div>
    </header>

}
export default Header;
